import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import './Contenido_Inse.css'

class Contenido_Inse extends React.Component {
  render() {
    return (
      <div>
        <body>
          <div id='guarda'>
            <div id='elegir'>
              <img src='/img/usuario50.jpg' alt='' />
              <br />
              <br />
              <ol><li><Link to="Lo">Login</Link></li></ol>
              <a href="/Login">Usuario</a>

            </div>
            <div id='elegir'>
              <img src='/img/usuario50.jpg' alt='' />
              <br />
              <br />
              <a href="/Hlogin">Huella</a>
            </div>
          </div>
        </body>
      </div>
    )
  }
}
export default Contenido_Inse;
